import React from "react";
import "./resume.scss";

const Resume = () => {
  return (
    <div className="resume">
      <div className="top">
        <img src={process.env.PUBLIC_URL + "/images/Profilbild.jpg"} alt="Jakob Persson"/>
        <h1>Jakob Persson</h1>
        <h4>Student Master of Engineering in Interaction & Design</h4>
      </div>
      <div className="education">
          <h2>Education</h2>
         <div className="year">

         </div>
         <div></div>
      </div>
    </div>
  );
};
export default Resume;
